package com.victor.data;import java.io.Serializable;import java.util.List;/** * Created by victor on 2016/10/19. */public class ProgramData implements Serializable{    private int count;    private List<ProgramInfo> categorys;    public int getCount() {        return count;    }    public List<ProgramInfo> getCategorys() {        return categorys;    }    public void setCount(int count) {        this.count = count;    }    public void setCategorys(List<ProgramInfo> categorys) {        this.categorys = categorys;    }}